import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Layout from './components/Layout';
// ... (all page imports)
import Home from './pages/Home';
import Product from './pages/Product';
import Solutions from './pages/Solutions';
import Pricing from './pages/Pricing';
import Resources from './pages/Resources';
import About from './pages/About';
import Careers from './pages/Careers';
import Contact from './pages/Contact';
import Terms from './pages/Terms';
import Privacy from './pages/Privacy';
import Cookies from './pages/Cookies';
import Login from './pages/Login';
import Signup from './pages/Signup';
import ForgotPassword from './pages/ForgotPassword';
import Dashboard from './pages/Dashboard';
import Orders from './pages/Orders';
import ProductsManage from './pages/ProductsManage';
import Finances from './pages/Finances';
import Blog from './pages/Blog';
import BlogPost from './pages/BlogPost';
import HelpCenter from './pages/HelpCenter';
import SuccessStories from './pages/SuccessStories';
import Webinars from './pages/Webinars';
import BasicPlan from './pages/BasicPlan';
import PartnerPlan from './pages/PartnerPlan';
import DynamicPlan from './pages/DynamicPlan';
import BuildTransferService from './pages/BuildTransferService';
import Subscription from './pages/Subscription';
import AiImageGeneratorGuide from './pages/AiImageGeneratorGuide';
import AiInventoryAutomationGuide from './pages/AiInventoryAutomationGuide';
import AiMarketingCampaignsGuide from './pages/AiMarketingCampaignsGuide';
import AiPricingOptimization from './pages/AiPricingOptimization';
import BestPracticesAiDescriptions from './pages/BestPracticesAiDescriptions';
import ConnectMarketplaceGuide from './pages/ConnectMarketplaceGuide';
import HowRevenueSharingWorksGuide from './pages/HowRevenueSharingWorksGuide';
import OptimizePricingWithAiGuide from './pages/OptimizePricingWithAiGuide';
import PriceOptimizationConversionGuide from './pages/PriceOptimizationConversionGuide';
import ProductEditDeleteGuide from './pages/ProductEditDeleteGuide';
import SeoOptimizationToolsGuide from './pages/SeoOptimizationToolsGuide';
import SetupProfileGuide from './pages/SetupProfileGuide';
import SocialMediaSchedulerGuide from './pages/SocialMediaSchedulerGuide';
import UnderstandingDashboardGuide from './pages/UnderstandingDashboardGuide';
import UpgradeDowngradePlanGuide from './pages/UpgradeDowngradePlanGuide';
import ViewingInvoicesGuide from './pages/ViewingInvoicesGuide';
import LoginSuccess from './pages/LoginSuccess';
import FullStatement from './pages/FullStatement';
import GenerateReport from './pages/GenerateReport';
import Invoice from './pages/Invoice';
import OrderDetail from './pages/OrderDetail';
import OrderTracking from './pages/OrderTracking';
import ProductAddEdit from './pages/ProductAddEdit';
import ProductDisplay from './pages/ProductDisplay';
import UpdatePayment from './pages/UpdatePayment';
import Trends from './pages/Trends';
import MarketingTools from './pages/MarketingTools';
import LiveAnalytics from './pages/LiveAnalytics';
import NewImageStylesUpdate from './pages/NewImageStylesUpdate';

function App() {
  const AppLayout = ({ children }) => <Layout>{children}</Layout>;

  return (
    <Router>
      <Routes>
        {/* All routes are defined here as before */}
        <Route path="/" element={<AppLayout><Home /></AppLayout>} />
        <Route path="/product" element={<AppLayout><Product /></AppLayout>} />
        <Route path="/solutions" element={<AppLayout><Solutions /></AppLayout>} />
        <Route path="/pricing" element={<AppLayout><Pricing /></AppLayout>} />
        <Route path="/resources" element={<AppLayout><Resources /></AppLayout>} />
        <Route path="/about" element={<AppLayout><About /></AppLayout>} />
        <Route path="/careers" element={<AppLayout><Careers /></AppLayout>} />
        <Route path="/contact" element={<AppLayout><Contact /></AppLayout>} />
        <Route path="/terms" element={<AppLayout><Terms /></AppLayout>} />
        <Route path="/privacy" element={<AppLayout><Privacy /></AppLayout>} />
        <Route path="/cookies" element={<AppLayout><Cookies /></AppLayout>} />
        <Route path="/dashboard" element={<AppLayout><Dashboard /></AppLayout>} />
        <Route path="/orders" element={<AppLayout><Orders /></AppLayout>} />
        <Route path="/products-manage" element={<AppLayout><ProductsManage /></AppLayout>} />
        <Route path="/finances" element={<AppLayout><Finances /></AppLayout>} />
        <Route path="/blog" element={<AppLayout><Blog /></AppLayout>} />
        <Route path="/blog-post" element={<AppLayout><BlogPost /></AppLayout>} />
        <Route path="/help-center" element={<AppLayout><HelpCenter /></AppLayout>} />
        <Route path="/success-stories" element={<AppLayout><SuccessStories /></AppLayout>} />
        <Route path="/webinars" element={<AppLayout><Webinars /></AppLayout>} />
        <Route path="/basic-plan" element={<AppLayout><BasicPlan /></AppLayout>} />
        <Route path="/partner-plan" element={<AppLayout><PartnerPlan /></AppLayout>} />
        <Route path="/dynamic-plan" element={<AppLayout><DynamicPlan /></AppLayout>} />
        <Route path="/build-transfer-service" element={<AppLayout><BuildTransferService /></AppLayout>} />
        <Route path="/subscription" element={<AppLayout><Subscription /></AppLayout>} />
        <Route path="/ai-image-generator-guide" element={<AppLayout><AiImageGeneratorGuide /></AppLayout>} />
        <Route path="/ai-inventory-automation-guide" element={<AppLayout><AiInventoryAutomationGuide /></AppLayout>} />
        <Route path="/ai-marketing-campaigns-guide" element={<AppLayout><AiMarketingCampaignsGuide /></AppLayout>} />
        <Route path="/ai-pricing-optimization" element={<AppLayout><AiPricingOptimization /></AppLayout>} />
        <Route path="/best-practices-ai-descriptions" element={<AppLayout><BestPracticesAiDescriptions /></AppLayout>} />
        <Route path="/connect-marketplace-guide" element={<AppLayout><ConnectMarketplaceGuide /></AppLayout>} />
        <Route path="/how-revenue-sharing-works-guide" element={<AppLayout><HowRevenueSharingWorksGuide /></AppLayout>} />
        <Route path="/optimize-pricing-with-ai-guide" element={<AppLayout><OptimizePricingWithAiGuide /></AppLayout>} />
        <Route path="/price-optimization-conversion-guide" element={<AppLayout><PriceOptimizationConversionGuide /></AppLayout>} />
        <Route path="/product-edit-delete-guide" element={<AppLayout><ProductEditDeleteGuide /></AppLayout>} />
        <Route path="/seo-optimization-tools-guide" element={<AppLayout><SeoOptimizationToolsGuide /></AppLayout>} />
        <Route path="/setup-profile-guide" element={<AppLayout><SetupProfileGuide /></AppLayout>} />
        <Route path="/social-media-scheduler-guide" element={<AppLayout><SocialMediaSchedulerGuide /></AppLayout>} />
        <Route path="/understanding-dashboard-guide" element={<AppLayout><UnderstandingDashboardGuide /></AppLayout>} />
        <Route path="/upgrade-downgrade-plan-guide" element={<AppLayout><UpgradeDowngradePlanGuide /></AppLayout>} />
        <Route path="/viewing-invoices-guide" element={<AppLayout><ViewingInvoicesGuide /></AppLayout>} />
        <Route path="/full-statement" element={<AppLayout><FullStatement /></AppLayout>} />
        <Route path="/invoice" element={<AppLayout><Invoice /></AppLayout>} />
        <Route path="/order-detail" element={<AppLayout><OrderDetail /></AppLayout>} />
        <Route path="/product-add-edit" element={<AppLayout><ProductAddEdit /></AppLayout>} />
        <Route path="/product-display" element={<AppLayout><ProductDisplay /></AppLayout>} />
        <Route path="/trends" element={<AppLayout><Trends /></AppLayout>} />
        <Route path="/marketing-tools" element={<AppLayout><MarketingTools /></AppLayout>} />
        <Route path="/live-analytics" element={<AppLayout><LiveAnalytics /></AppLayout>} />
        <Route path="/new-image-styles-update" element={<AppLayout><NewImageStylesUpdate /></AppLayout>} />

        {/* Standalone Routes */}
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/forgot-password" element={<ForgotPassword />} />
        <Route path="/login-success" element={<LoginSuccess />} />
        <Route path="/generate-report" element={<GenerateReport />} />
        <Route path="/order-tracking" element={<OrderTracking />} />
        <Route path="/update-payment" element={<UpdatePayment />} />
      </Routes>
    </Router>
  );
}

export default App;
